</input>
         <label for="password"></label><br></br>
        <div class = "password">
        <input class="pass-field" name="password" placeholder="Password"  type="password" id="password"></input>
        <input class="pass-icon" type="checkbox" onclick="myFunction()"></input>
        </div><br></br>
        <button class="btn btn-outline-primary" >Login</button>
        </div>
    );
}

